import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

function EventoView() {
  const { id } = useParams();
  const { evento, setEvento } = useState({}); 

  useEffect(() => {
    console.log('Entre al useEffect');
    console.log(id);

    fetch(`http://localhost:3333/api/eventos/${id}`)
      .then(res => res.json())
      .then((data) => {
        console.log(JSON.parse(data))
        setEvento(JSON.parse(data));
      })
  }, []);


  return (
    <div>
      <h1>EventoView</h1>
      <p>Hola {evento}</p>
    </div>
  );
}

export default EventoView;
